import React from 'react';
import Slider from 'react-slick';

const MyTitle: React.FC = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <Slider {...settings}>
      <div>
        A business systems analyst
      </div>
      <div>
        An UI/UX designer
      </div>
      <div>
        A creative web developer with a focus on frontend
      </div>
    </Slider>
  );
}

export default MyTitle;
